import React from "react";

export default function GamesList() {
  return (
    <main>
      <h2>All Games(65)</h2>
      <div className="filters">
        <span>Showing</span>
        <select name="genrer" id="genrer">
          <option value="All Games">All Games</option>
        </select>
      </div>
    </main>
  );
}
